import React, { Component } from 'react'
import ReactApexChart from 'react-apexcharts'


class Charts extends Component {
    
  state = {
    series: [],
    options: {
      // dataLabels: {
      //   enabled: true
      // },
      chart: {
        id: 'realtime',
        height: 600,
        type: 'line',
        animations: {
          enabled: true,
          easing: 'linear',
          dynamicAnimation: {
            speed: 1000
          }
        },
        toolbar: {
          show: false
        },
        zoom: {
          enabled: false
        }
      },
      dataLabels: {
        enabled: false,
        formatter: function(value, { seriesIndex, dataPointIndex, w }) {
          if (true)
          return value
        }
      },
      stroke: {
        curve: 'smooth'
      },
      title: {
        text: 'Viewer count of Dota 2, Rocket League and HearthStone',
        align: 'left'
      },
      markers: {
        size: 0
      },
      xaxis: {
        type: 'category',
        // categories: [1991,1992,1993,1994,1995,1996,1997, 1998,1999],
        range: 10,
      },
      yaxis: {
        // max: 100
      },
      legend: {
        show: true
      },
    }, 
  };
    
  render() {
      return (
          <div id="chart">  
              <ReactApexChart style={{width: "80%"}} options={this.state.options} series={this.props.series} type="line" height={500} />
          </div>
      )
  }
}
 
export default Charts
